import React from "react";
import { Link } from "react-router-dom";

export default function NotFound() {
  return (
    <div>
      <h1>Oops! You seem to be lost.</h1>
      <p>Here are some helpful links:</p>
      <Link to='/'>Home</Link>
      <Link to='/blog'>Blog</Link>
      <Link to='/contact'>Contact</Link>
    </div>
  );
}
